One of the fun things we are sharing at the party this weekend are these super cute new looms! In collaboration with @aneedlerunsthroughit (who will be at the party in real actual life!), we created our popular Bookmark and Mini Looms, and we will be debuting our Rainbow Looms as well as some more adorable ornament looms (not yet listed in our shop). 

Scroll through to see all of these wonderful looms, and snag yours either at the link in our bio (the @craftemporiumpdx Etsy shop), OR in person at one of our open days or a the party this weekend. Speaking of, it’s Crafternoon night, friends! We’ll be at the studio from 4-8 hanging out and crafting (or, maybe finishing the set up of the studio after our weekend at the @maggiemaes holiday bazaar).

